"""# <font color='red' style='font-size: 30px;'>Estimando um Modelo de Regressão Linear para o consumo</font>
<hr style='border: 2px solid red;'>

## Importando o train_test_split da biblioteca scikit-learn
"""

from sklearn.model_selection import train_test_split

"""### Criando uma Series (pandas) para armazenar o consumo de Cerveja (y)

"""

y = dados['consumo']

"""### Criando um DataFrame (panda) para armazenar as variáveis explicativas (X)"""

X = dados[['temp_max', 'chuva', 'fds']]

"""### Criando os datasets de treino e de teste"""

X_train, X_test, y_train, y_test = train_test_split(X, y, test_size=0.3, random_state=2811)

"""### Verificando os tamanhos dos arquivos gerados pela função train_test_split"""

X_train.shape

X_test.shape

y_train.shape

y_test.shape



"""![image.png](data:image/png;base64,)

### Importando Linear Regression e metrics da biblioteca scikit-learn
"""

from sklearn.linear_model import LinearRegression
from sklearn import metrics

"""### Instanciando a classe LinearRegression()"""

modelo = LinearRegression()

"""## Utilizando o método fit() do objeto "modelo" para estimar nosso modelo linear utilizando os dados de TREINO (y_train e X_train)"""

modelo.fit(X_train, y_train)

"""## Obtendo o coeficiente de determinação (R²) do modelo estimado com os dados de TREINO

![image.png](data:image/png;base64,)
"""

print('R² = {}'. format(modelo.score(X_train, y_train).round(2)))

"""## Gerando previsões para os dados de TESTE (X_test) utilizando o método predict()_ do objeto "modelo"
"""

y_previsto = modelo.predict(X_test )

"""## Obtendo o coeficiente de determinação (R²) para as previsões do nosso modelo """

print('R² = %s' % metrics.r2_score(y_test, y_previsto).round(2))

"""# <font color='red' style='font-size: 30px;'>Obtendo Previsões Pontuais</font>
<hr style='border: 2px solid red;'>

## Dados de entrada
"""

entrada = X_test[0:1]
entrada

"""## Gerando previsão pontual"""

modelo.predict(entrada)[0]

"""## Criando um simulador simples"""

temp_max = 30.5
chuva = 12.2
fds = 0
entrada = [[temp_max, chuva, fds]]

print('{0:.2f} Litros'.format(modelo.predict(entrada)[0]))

"""# <font color='red' style='font-size: 30px;'>Interpretação dos Coeficientes Estimados</font>
<hr style='border: 2px solid red;'>

![Sem título.png](data:image/png;base64,)

## Obtendo o Intercepto do modelo

### O intercepto representa o efeito médio em Y (consumo de Cerveja) tendo todas as variáveis explicativas excluídas do modelo. De forma mais simples, o intercepto representa o efeito médio em Y (consumo de Cerveja) quando X2 (Temperatura Máxima), X3 (chuva) e X4 (Final de semana) são iguais a zero.
"""

modelo.intercept_

type(modelo.intercept_)

"""## Obtendo os coeficientes de regressão 

### Os coeficientes de regressão B2, B3 e B4 são conhecidos como coeficientes parciais de regressão ou coeficientes parciais angulares. Considerando o número de variáveis explicativas de nosso modelo, seu significado seria o seguinte: B2 mede a variação no valor médio de Y (consumo de cerveja), por unidade de variação de X2 (temperatura Máxima), mantendo-se os valores de X3 (chuva) e X4 (Final de semana) constantes. Em outras palavras, ele nos dá o efeito "direto" ou "liquido" de uma unidade de variação de X2 sobre o valor médio de Y, excluídos os efeitos que X3 e X4 possam ter sobre a média de Y. De modo análogo podemos interpretar os demais coeficientes de regressão.
"""

modelo.coef_

type(modelo.coef_)

"""## Confirmando a ordem das variáveis explicativas no DataFrame"""

X.columns

"""## Criando uma lista com os nomes das variáveis do modelo"""

index = ['Intercepto', 'Temperatura Máxima', 'Chuva (mm)', 'Final de Semana']

"""## Criando o DataFrame para armazenar os coeficientes do modelo"""

pd.DataFrame(data=np.append(modelo.intercept_, modelo.coef_), index=index, columns=['Parâmetros'])

"""## Interpretação dos Coeficientes Estimados

### Intercepto -> Excluindo o efeito das variáveis explicativas ( X2 = X3 = X4 = 0 ) o efeito médio no consumo de cerveja seria de 5951,98 litros. 

### Temperatura Máxima (°C) -> Mantendo-se os valores de X3 (chuva) e X4 (Final de semana) constantes, o acréscimo de 1°C na temperatura Máxima gera uma variáção média no consumo de cerveja de 684,74 litros.

### Chuva (mm) -> Mantendo-se os valores de X2 (Temperatura Máxima) e X4 (Final de semana) constantes, o acréscimo de 1 mm de chuva gera uma variação média no consumo de cerveja de - 60,78 litros.

### Final de semana -> Mantendo-se os valores de X2 (Temperatura Máxima) e X3 (chuva) constantes, o fato de o dia ser classificado como final de semana gera uma variação média no consumo de cerveja de 5401,08 litros.

# <font color='red' style='font-size: 30px;'>Análise Gráficas das Previsões do  Modelo</font>
<hr style='border: 2px solid red;'>

## Gerando as previsões do modelo para os dados de TREINO
"""

y_previsto_train = modelo.predict(X_train)

"""## Gráfico de dispersão entre valor estimado e valor real

### Método informal de verificação da hipótese da variância constante dos resíduos (homocedasticidade)
"""

ax = sns.scatterplot(x=y_previsto_train, y=y_train)
ax.figure.set_size_inches(12, 6)
ax.set_title('Previsão X Real', fontsize=18)
ax.set_xlabel('Consumo de Cerveja (litros) - Previsão', fontsize=14)
ax.set_ylabel('Consumo de Cerveja (litros) - Real', fontsize=14)
ax

"""## Obtendo os resíduos """

residuo = y_train - y_previsto_train

ax = sns.scatterplot(x=y_previsto_train, y=residuo, s= 150)
ax.figure.set_size_inches(20, 8)
ax.set_title('Resíduos X Previsão', fontsize=18)
ax.set_xlabel('Consumo de Cerveja (litros) - Previsão', fontsize=14)
ax.set_ylabel('Resíduos', fontsize=14)
ax

"""### Utilizando os resíduos ao quadrado

![image.png](data:image/png;base64,)
"""

ax = sns.scatterplot(x=y_previsto_train, y=residuo**2, s= 150)
ax.figure.set_size_inches(20, 8)
ax.set_title('Resíduos X Previsão', fontsize=18)
ax.set_xlabel('Consumo de Cerveja (litros) - Previsão', fontsize=14)
ax.set_ylabel('Resíduos²', fontsize=14)
ax

"""## Plotando a distribuição de frequências dos resíduos """

ax = sns.distplot(residuo)
ax.figure.set_size_inches(12, 6)
ax.set_title('Distribuição de Frequências dos Resíduos', fontsize=18)
ax.set_xlabel('Litros', fontsize=14)
ax

"""# <font color='red' style='font-size: 30px;'>Comparando Modelos</font>
<hr style='border: 2px solid red;'>

Estimando um novo modelo com a substituição da variável explicativa Temperatura Máxima pela Temperatura Média
"""

