"""Obtendo o coeficiente de determinação (R²) para as previsões dos dois modelos """

print('Modelo com Temp. Média')
print('R² = {}'. format(metrics.r2_score(y2_test, y_previsto_2).round(2)))

print('Modelo com Temp. Máxima')
